  <script src="http://ajax.googleapis.com/ajax/libs/jquery/1.11.1/jquery.min.js"></script>
  <script type="text/javascript">
    window.onload = function () {
      $.ajax({
          type: "GET",
          url: "https://back.lamaisonreconnectee.fr/api/r/digital-services",
          contentType: "application/json; charset=utf-8",
          dataType: "json",
          success: function (services) {
              services.forEach(service => {
                if(service.scope != 'National') {
                  const dept = document.querySelectorAll('[id="'+ service.scope + '"]');
                  dept.forEach(departement => {
                    departement.style.fill = '#FFFFFF';
                    departement.classList.add("clickable");
                    departement.addEventListener("click", _navigate);
                  });
                }
              });
          },
          error: function (xhr, ajaxOptions, thrownError) {
              console.log(xhr.status);
              console.log(thrownError);
          }
      });
    }

    function _navigate() {
        window.location.href = "/door/"+this.id;
    }

    function national() {
      window.location.href = "/door/"
    }
  </script>
